import HeaderComponent from './components/HeaderComponent';
import FooterComponents from './components/FooterComponents';

function App() {
  return (
    <div>
      <HeaderComponent/>
      <Router>
      <Routes>
        <Route exact path='/bookList' element={<BookListComponent/>}>

        </Route>
      </Routes>
      </Router>
      <div>
        <FooterComponents/>
      </div>
    </div>
